.timeUl{
    height: 100%;
    width: 160%;
    position: relative;
    left: 0;
    -webkit-transition: all ease 0.8s;
    -moz-transition: all ease 0.8s;
    -ms-transition: all ease 0.8s;
    transition: all ease 0.8s;
}

.timeUl::before{
    content: ' ';
    top: 50%;
    position: absolute;
    height: 0;
    width: 100%;
    padding: 0 20px;
    border:1px dashed #ffffff;
    display: block;
}

.timeUl::after{
    content: '';
    display: table;
    clear: both;
}

.timeUl li{
    width: 25%;
    float: left;
    height: 100%;
    position: relative;
}

.timeUl li::before{
    content: ' ';
    top: 50%;
    left: 50%;
    position: absolute;
    height: 0;
    width: 12px;
    height: 12px;
    border: 4px solid #E7A98F;
    display: block;
    z-index: 35;
    background: #ffffff;
    border-radius: 50%;
    margin-top: -8px;
    margin-left: -8px;
}

.timeUl li div{
    height: 45%;
    width: 100%;
    background-color: #444444;
    filter:alpha(opacity=90);  
    -moz-opacity:0.9;  
    -khtml-opacity: 0.9;  
    opacity: 0.9;  
    text-align: center;
    color: #ffffff;
    box-shadow: 10px 10px 5px #000000;
}

.timeUl li:nth-child(2n) div{
    position: absolute;
    bottom: 10px;
}

